import React from 'react';
import styled from 'styled-components';
import HomeCard from './HomeCard'; // Assurez-vous que le chemin est correct

const Wrapper = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  gap: 20px; /* Espace entre les cartes */
  background-color: #8B2514;
  padding: 50px;
  transition: background-color 0.3s ease;

  /* Vérification des propriétés : s'assurer que les éléments enfants sont bien visibles */
  & > div {
    flex-shrink: 0; /* Empêche les cartes de se réduire si elles sont trop grandes */
  }
`;

const CardsWrapper = () => {
  return (
    <Wrapper>
      <HomeCard image="/path-to-image/june-baby.png" rotate="-5deg" />
      <HomeCard image="/path-to-image/love-yourself.png" rotate="0deg" />
      <HomeCard image="/path-to-image/love.png" rotate="5deg" />
    </Wrapper>
  );
};

export default CardsWrapper;
